INSERT INTO `PRO_clip_repository` VALUES (12681278,'http://www.ilfriuli.it:80/rss.ashx','http://www.ilfriuli.it/articolo/spettacoli/omaggio-alle-stelle-ritratte-da-o’neill/7/191552','2019/01/15/08278541d2a3837ec57739e6d40a053d.gz','Omaggio alle stelle ritratte da O’Neill\n',' \'Stars: Ritratti fotografici di Terry O’Neill\' è in corso a Trieste al Magazzino delle Idee','\nS’intitola Movies & Music Stars il programma di iniziative speciali che accompagna l’esposizione Stars: Ritratti fotografici di Terry O’Neill , in corso a Trieste al Magazzino delle Idee . Una mostra, quella dedicata al fotografo amico delle stelle (dalle rockstar alle attrici), che comprende spazi speciali come un vero set fotografico, #ToBeFaye , dove chiunque può immedesimarsi in Faye Dunaway nella celebre foto di O’Neill (suo marito!) Faye and the Oscar , scattata al Beverly Hills Hotel di Los Angeles il 29 marzo 1977 , il mattino dopo aver ricevuto l’Oscar!\nPrendendo spunto dai tanti personaggi ritratti dal fotografo britannico, la Casa del Cinema ha pensato ad una rassegna cinematografica fatta di serate-evento al Teatro Miela , partita con un omaggio a David Bowie a tre anni dalla scomparsa. Seguiranno mercoledì 16 il Dj set di The Fab e la proiezione di E yes of Laura Mars e Mommie Dearest , entrambi con la Dunaway. In programma, poi, una serata interamente dedicata ai Beatles (cui O’ Neill scattò la prima foto ufficiale) il   30 gennaio , con Dj Jaguar e la proiezione dei documentari 8 Days a Week di Ron Howard e Sgt Pepper & Beyond  di Alan Parker .\nIl 6 febbraio ci sarà una Swinging London Evening con Dj Jazz Master e la proiezione di My Generation di David Batty e Absolute Beginners di Julien Temple . In calendario anche due concerti live al Magazzino delle Idee che omaggeranno due stelle della musica esposte in mostra: Frank Sinatra , con il trio jazz Modazu (Morpurgo, Davanzo, Zulian) sabato 19 , e Amy Winehouse , con la band Back To Amy sabato 2 febbraio . \n','it','2019-01-15 02:1